import React from 'react';
import './App.css';
import { LoginForm } from './components/LoginForm';
import { HomePage } from './pages/HomePage';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element=<HomePage/> ></Route>
      </Routes>
      <HomePage />
      <LoginForm />
    </div>
  );
}

export default App;
